import { useEffect, useState } from "react";

const UseCustom=(url)=>{ 
    const[x,setx]=useState([])
    useEffect(()=>{
        fetch(url)
      .then(response => response.json())
      .then(json =>setx(json))
      },[])
       
      return[x]
};
export default UseCustom;
